import styled from "styled-components";

const BodyWrapper = styled.div`
  .plus {
    display: flex;
    justify-content: center;
    align-items: center;
    position: relative;
  }
  .plusButton {
    position: absolute;
    width: 70px;
    height: 70px;
    border-radius: 50%;
    padding: 0;
  }
`;

export default BodyWrapper;
